                <label className='mt-3'>Name of image</label>
                <input type="text" className={`${styles.input}`}></input>
                <label className='mt-3'>URL of image</label>
                <input type="text" className={`${styles.input}`}></input>
                <label className='mt-3'>Associated theme</label>
                <input type="text" className={`${styles.input}`}></input>
            </form>
        </div>
    )
}
